import { useState, lazy, Suspense } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Loader from './Components/Assets/Loader';
import './Css/style.css';
import Navbar from './Components/Assets/Navbar';
import Header from './Components/Assets/Header';
import Footer from './Components/Assets/Footer';
import Toast from './Components/Assets/Toast';
import { useEffect } from 'react';

const Main = lazy(() => import("./Components/Pages/Main"))
const About = lazy(() => import("./Components/Pages/About"))
const Team = lazy(() => import("./Components/Team/Team"))
const BrowseBlogs = lazy(() => import("./Components/Pages/BrowseBlogs"))
const Registration = lazy(() => import("./Components/Registration/Registration"))
const Login = lazy(() => import("./Components/Registration/Login"))
const ResetPassword = lazy(() => import("./Components/Registration/ResetPassword"))
const BlogDetails = lazy(() => import("./Components/Pages/BlogDetails"))
const Notification = lazy(() => import("./Components/Notification/Notification"))
const Settings = lazy(() => import("./Components/Settings/Settings"))


function App() {
  const [activeToast, setActiveToast] = useState(null)
  const ShowToast = (icon, title, msg) => {
    setActiveToast({ icon, title, msg })
    setTimeout(() => {
      setActiveToast(null)
    }, 3500);
  }
  const getFont = localStorage.getItem("font_mode");

  useEffect(() => {
      document.body.classList.add(getFont);
},[getFont])
  return (
    <>

      <BrowserRouter>
        <Navbar ShowToast={ShowToast} />
        <Header />

        <Suspense fallback={<Loader />}>

          <Routes>
            <Route path="/" element={<Main />} />
            <Route path="/about" element={<About />} />
            <Route path="/team" element={<Team />} />
            <Route path="/browse" element={<BrowseBlogs />} />
            <Route path="/browse/details" element={<BlogDetails />} />
            <Route path="/notification" element={<Notification />} />
          </Routes>

          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Registration />} />
            <Route path="/login/reset" element={<ResetPassword />} />
          </Routes>

          <Routes>
            <Route path="/settings" element={<Settings ShowToast={ShowToast} />} />
            <Route path="/settings/profile" element={<Settings ShowToast={ShowToast} Active="profile" />} />
            <Route path="/settings/billing" element={<Settings ShowToast={ShowToast} Active="billing" />} />
            <Route path="/settings/customize" element={<Settings ShowToast={ShowToast} Active="customize" />} />
            <Route path="/settings/notification" element={<Settings ShowToast={ShowToast} Active="notification" />} />
          </Routes>

        </Suspense>

        <Toast toastData={activeToast} removeToast={setActiveToast} />
        <Footer />
      </BrowserRouter>



    </>
  );
}

export default App;
